import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { all_routes } from '../../router/all_routes';
import ImageWithBasePath from '../../../core/common/imageWithBasePath';
import CircleProgress from './circleProgress';
import ReactApexChart from 'react-apexcharts';
import { Calendar } from 'primereact/calendar';
import { Nullable } from 'primereact/ts-helpers';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import dayjs from 'dayjs';
import { DatePicker } from 'antd';

const PlayerDasboard = () => {
  const routes = all_routes;
  const today = new Date();
  const year = today.getFullYear();
  const month = String(today.getMonth() + 1).padStart(2, '0'); // Month is zero-based, so we add 1
  const day = String(today.getDate()).padStart(2, '0');
  const formattedDate = `${month}-${day}-${year}`;
  const defaultValue = dayjs(formattedDate);
  const [date, setDate] = useState<Nullable<Date>>(null);

  const [attendance_chart] = useState<any>({
    chart: {
      height: 255,
      type: 'donut',
      toolbar: {
        show: false,
      },
    },
    plotOptions: {
      bar: {
        horizontal: false,
        columnWidth: '50%',
      },
    },
    dataLabels: {
      enabled: false,
    },

    series: [60, 5, 15, 20],
    labels: ['Present', 'Late', 'Half Day', 'Absent'],
    colors: ['#1ABE17', '#1170E4', '#E9EDF4', '#E82646'],
    responsive: [
      {
        breakpoint: 480,
        options: {
          chart: {
            width: 200,
          },
          legend: {
            position: 'bottom',
          },
        },
      },
    ],
    legend: {
      position: 'bottom',
    },
  });
  const [performance_chart] = useState<any>({
    chart: {
      type: 'area',
      height: 355,
    },
    series: [
      {
        name: 'Avg. Exam Score',
        data: [75, 68, 65, 68, 75], // Sample data
      },
      {
        name: 'Avg. Attendance',
        data: [85, 78, 75, 78, 85], // Sample data
      },
    ],
    xaxis: {
      categories: [
        'Quarter 1',
        'Quarter 2',
        'Half yearly',
        'Model',
        'Final Exam',
      ],
    },
    tooltip: {
      y: {
        formatter: function (val: any) {
          return val + '%';
        },
      },
      shared: true,
      intersect: false,
      custom: function ({ series, seriesIndex, dataPointIndex, w }: any) {
        return `<div class="apexcharts-tooltip">${w.globals.labels[dataPointIndex]}<br>Exam Score: <span style="color: #1E90FF;">${series[0][dataPointIndex]}%</span><br>Attendance: <span style="color: #00BFFF;">${series[1][dataPointIndex]}%</span></div>`;
      },
    },
    dataLabels: {
      enabled: false,
    },
    stroke: {
      curve: 'smooth',
    },
    grid: {
      yaxis: {
        axisTicks: {
          show: true,
          borderType: 'solid',
          color: '#78909C',
          width: 6,
          offsetX: 0,
          offsetY: 0,
        },
      },
    },
    markers: {
      size: 5,
      colors: ['#1E90FF', '#00BFFF'],
      strokeColors: '#fff',
      strokeWidth: 2,
      hover: {
        size: 7,
      },
    },
    colors: ['#3D5EE1', '#6FCCD8'], // Color for the lines
    fill: {
      type: 'gradient',
      gradient: {
        shadeIntensity: 1,
        opacityFrom: 0.7,
        opacityTo: 0.9,
        stops: [0, 90, 100],
      },
    },
    legend: {
      position: 'bottom',
      horizontalAlign: 'center',
    },
  });
  const [exam_result_chart] = useState<any>({
    chart: {
      type: 'bar',
      height: 310,
    },
    series: [
      {
        name: 'Marks',
        data: [100, 92, 90, 82, 90], // Corresponding scores for Maths, Physics, Chemistry, English, Spanish
      },
    ],
    xaxis: {
      categories: ['Mat', 'Phy', 'Che', 'Eng', 'Sci'],
    },
    plotOptions: {
      bar: {
        distributed: true,
        columnWidth: '50%',
        colors: {
          backgroundBarColors: ['#E9EDF4', '#fff'],
          backgroundBarOpacity: 1,
          backgroundBarRadius: 5,
        },
        dataLabels: {
          position: 'top',
        },
      },
    },
    colors: ['#E9EDF4', '#3D5EE1', '#E9EDF4', '#E9EDF4', '#E9EDF4'], // Set specific colors for each bar
    tooltip: {
      y: {
        formatter: function (val: any) {
          return val + '%';
        },
      },
    },
    dataLabels: {
      enabled: true,
      formatter: function (val: any) {
        return val + '%';
      },
      offsetY: -20,
      style: {
        fontSize: '14px',
        colors: ['#304758'],
      },
    },
    grid: {
      yaxis: {
        lines: {
          show: false,
        },
      },
    },

    legend: {
      show: false,
    },
  });
  function SampleNextArrow(props: any) {
    const { style, onClick } = props;
    return (
      <div
        className='slick-nav slick-nav-next class-slides'
        style={{ ...style, display: 'flex', top: '-60px', right: '0' }}
        onClick={onClick}
      >
        <i className='fas fa-chevron-right' style={{ fontSize: '12px' }}></i>
      </div>
    );
  }

  function SamplePrevArrow(props: any) {
    const { style, onClick } = props;
    return (
      <div
        className='slick-nav slick-nav-prev class-slides'
        style={{ ...style, display: 'flex', top: '-60px', right: '30px' }}
        onClick={onClick}
      >
        <i className='fas fa-chevron-left' style={{ fontSize: '12px' }}></i>
      </div>
    );
  }
  const profile = {
    dots: false,
    autoplay: false,
    slidesToShow: 5,
    margin: 24,
    speed: 500,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    responsive: [
      {
        breakpoint: 1500,
        settings: {
          slidesToShow: 5,
        },
      },
      {
        breakpoint: 1400,
        settings: {
          slidesToShow: 5,
        },
      },
      {
        breakpoint: 992,
        settings: {
          slidesToShow: 4,
        },
      },
      {
        breakpoint: 800,
        settings: {
          slidesToShow: 3,
        },
      },
      {
        breakpoint: 776,
        settings: {
          slidesToShow: 2,
        },
      },
      {
        breakpoint: 567,
        settings: {
          slidesToShow: 1,
        },
      },
    ],
  };
  return (
    <>
      {/* Page Wrapper */}
      <div className='page-wrapper'>
        <div className='content'>
          {/* Page Header */}
          <div className='d-md-flex d-block align-items-center justify-content-between mb-3'>
            <div className='my-auto mb-2'>
              <h3 className='page-title mb-1'>Player Dashboard</h3>
              <nav>
                <ol className='breadcrumb mb-0'>
                  <li className='breadcrumb-item'>
                    <Link to={routes.adminDashboard}>Dashboard</Link>
                  </li>
                  <li className='breadcrumb-item active' aria-current='page'>
                    Player Dashboard
                  </li>
                </ol>
              </nav>
            </div>
          </div>
          {/* /Page Header */}
          <div className='row'>
            <div className='col-xxl-8 d-flex'>
              <div className='row flex-fill'>
                {/* Profile */}
                <div className='col-xl-6 d-flex'>
                  <div className='flex-fill'>
                    <div className='card bg-dark position-relative'>
                      <div className='card-body'>
                        <div className='d-flex align-items-center row-gap-3 mb-3'>
                          <div className='avatar avatar-xxl rounded flex-shrink-0 me-3'>
                            <ImageWithBasePath
                              src='assets/img/students/student-13.jpg'
                              alt='Img'
                            />
                          </div>
                          <div className='d-block'>
                            <span className='badge bg-transparent-primary text-primary mb-1'>
                              #ST1234546
                            </span>
                            <h3 className='text-truncate text-white mb-1'>
                              Angelo Riana
                            </h3>
                            <div className='d-flex align-items-center flex-wrap row-gap-2 text-gray-2'>
                              <span className='border-end me-2 pe-2'>
                                Class : III, C
                              </span>
                              <span>Roll No : 36545</span>
                            </div>
                          </div>
                        </div>
                        <div className='d-flex align-items-center justify-content-between profile-footer flex-wrap row-gap-3 pt-4'>
                          <div className='d-flex align-items-center'>
